import React from 'react'

const idCard = (className, imagePath, title, subtitle) => {
  return (
    <div className={className}>
      <img src={imagePath} alt="" />
      <h1 >{title}</h1>
      <h2>{subtitle}</h2>

    </div>
  )
}

export default idCard
